    position: fixed;
    right: -700px;
    transition: 0.8s;
    width: 70vw;
    background: $menuLi;
    &.expanded {
      justify-content: flex-start;
      position: fixed;
      right: 0;
      z-index: 1001;
      border-right: none;
      transition: 0.5s;
    }
    .nav-title {
      padding-top: 2rem;
      display: flex;
      flex-direction: column;
      justify-content: flex-end;
      .search-div {
        display: flex;
        flex-direction: column;
        justify-content: center;
      }
      h3 {
        display: none;
      }
    }
    ul {
      // height:75%;
      width: 90%;
      display: flex;
      flex-direction: column;
      justify-content: space-between;
    }
  }

  .nav__closeBtn {
    display: none;
    transform: translateX(-250px);
  }
  .nav__hamburger {
    position: fixed;
    top: 0.3rem;
    right: 0.6rem;
    z-index: 30;
    -webkit-transition: 0.8s;
    transition: 0.8s;
    width: 30px;
    height: 32px;
    background: transparent;
    border: none;
    padding: 0;
    cursor: pointer;
    &:focus {
      outline: none;
    }
  }

  .result__wrapper {
    display: none;
    margin-top: 0;
    padding: 2rem 0.6rem;
  }
  .bar {
    width: 100%;
    height: 3px;
    content: "";
    background: #333;
    display: inline-block;
    padding: 0;
    margin: 0;
    position: relative;
    border-radius: 6px;
    transition: all 0.8s;

    &.expand {
      transition: all 0.5s;
      background: $mainColor;
      width: 75%;
    }
  }
  .bar1 {
    top: 5px;
    &.expand {
      transform: rotate(45deg) translate(4px, 3px);
    }
  }
  .bar2 {
    width: 80%;
    right: 20%;
    &.expand {
      display: none;
    }
  }
  .bar3 {
    bottom: 5px;
    &.expand {
      transform: rotate(-45deg);
    }
  }

  .song__data {
    margin: 16px 0;
  }
  footer {
    font-size: 1rem;
    text-align: center;
    margin: 0;
    h3 {
      text-align: center;
    }
    h4 {
      text-align: center;
    }
  }
  .header-rules {
    width: 95vw;
    padding: 2rem 0.5rem;
    h1 {
      padding: 1rem 0;
    }
  }
  .rules-ol {
    padding-inline-start: 20px;
    text-align: center;
    li {
      padding: 0.7rem 0;
    }
  }
  .controls {
    left: 5%;
  }
  .nav__openBtn {
    display: none;
  }
}

//desktop, laptops
@media (min-width: 1168px) {
  header {
    background-image: url("../img/bg-header.jpg");
  }
  .nav__hamburger {
    display: none;
  }
  .nav {
    height: 100vh;
    width: 300px;
    position: fixed;
    z-index: 1;
    top: 0;
    left: -305px;
    background-color: $menuLi;
    overflow-x: hidden;
    transition: all 0.6s cubic-bezier(0.1, 0.58, 0.33, 0.83);
  }
}

@media (max-height: 620px) {
  nav ul li a {
    font-size: 0.9rem;
    padding: 0.35rem 1rem;
  }
  .player__container,
  iframe {
    width: 300px;
  }
  .search-div input {
    margin: 0.5rem 0;
  }
}
